import React from 'react';
import './Footer.css';

const Footer = () => {

    return (
        <div data-testid="footer" className="footer"> 
          <p data-testid="paragraphText">PANKOD CHALLENGE PROJECT </p>
        </div>

    );
};

export default Footer;
